function CreateTownMap(state)

  local id = "town"
  local townState = state.maps[id]

  local shopDefPotions =
  {
    name = "Potion Shop",
    stock =
    {
        { id = 10, price = 50 },
        { id = 11, price = 500 },
        { id = 12, price = 100 },
    },
    sell_filter = "support",
  }

  local shopDefArms =
  {
    name = "Arms Shop",
    stock =
    {
        { id = 1, price = 300 },
        { id = 2, price = 350 },
        { id = 4, price = 300 },
        { id = 5, price = 350 },
        { id = 7, price = 300 },
        { id = 8, price = 300 },
    },
    sell_filter = "arms",
  }

  local innDef =
  {
      cost = 5
  }

  local function TalkToMajor(map, trigger, entity, x, y, layer)

    local gemstoneId = 14

    if gGame.World:HasKey(gemstoneId) then

        local combatDef =
        {
            background = "combat_bg_town.png",
            enemy = { "demon_major" },
            canFlee = false,
        }

        local sayDef = { textScale = 1.5 }
        local bossTalk =
        {
            SOP.BlackScreen("blackscreen", 0),
            SOP.Say("handin", "hero", "Gemstone removed.", 2.05, sayDef),
            SOP.Say("handin", "major", "Ah, the gemstone. Thank you.", 3.2, sayDef),
            SOP.Say("handin", "major", "Fools!", 3.2, sayDef),
            SOP.Say("handin", "major", "How long I've waited.", 3.2, sayDef),
            SOP.Say("handin", "major", "Killing the major, taking his form...", 3.2, sayDef),
            SOP.Say("handin", "major", "To return to the corporeal realm...", 3.2, sayDef),
            SOP.Say("handin", "major", "and FEED!", 3.2, sayDef),
            SOP.RunAction("Combat", { map, combatDef }),
            SOP.NoBlock(
              SOP.Say("handin", "major", "Noooooo!", 1.5, sayDef)
            ),
            SOP.FadeOutChar("handin", "major", 1.75),
            SOP.Wait(0.2),
            SOP.FadeInScreen(),
            SOP.Function(function()
                            gGame.Stack = StateStack:Create()
                            gGame.Stack:Push(GameOverState:Create(gGame.Stack, gGame.World, true))
                         end)
        }

        local storyboard = Storyboard:Create(gGame.Stack, bossTalk, true)
        gGame.Stack:Push(storyboard)
    else

      -- Assume it's before player has the stone
      local message = "Go to the mine and get the gem. Then we can talk."
      local action = Actions.ShortText(map, message)
      action(trigger, entity, x, y, layer)
    end
  end

  local function MoveMajor(map)

      if townState.quest_given then
        local removeAction = Actions.RemoveNPC(map, "major")
        removeAction()
        local addAction = Actions.AddNPC(map,
                          {
                              def = "npc_major",
                              id = "major",
                              x = 5,
                              y = 5,
                              layer = 1
                          })
        addAction()
      end
  end


